import './App.css';
import Login from './Login'; // Import your Login component
import Lottie from "lottie-react";
import testanimation from "./testanimation.json";
import axios from 'axios'; // You might need to install axios via npm if you haven't already

function App() {
    const onLogin = async (username, password) => {
        try {
            const response = await axios.post('http://localhost:8080/unlimitedmarketplace/auth/login', {
                username: username,
                passwordHash: password // Ensure these keys match those expected by your backend
            });
            // Here you can store the received JWT token from the response for future requests
            // For example, in localStorage or context API for state management
            localStorage.setItem('token', response.data.token); // Adjust based on actual response structure
            console.log('Login successful', response.data);
        } catch (error) {
            console.error('Login failed:', error);
            throw error; // Throw error to catch it in the Login component for error handling
        }
    };

    return (
        <div>
            <Login onLogin={onLogin}/>
        </div>
    );
}

export default App;
